import React from "react";

export default function Skills() {
  const skills = [
    "React",
    "Vue",
    "Angular 6+",
    "AngularJS",
    "NextJs",
    "Javascript",
    "TypeScript",
    "Node",
    "Express",
    "GraphQL",
    "C#",
    "Redux-thunk",
    "Redux-Sagas",
    "Flux",
    "SQL",
    "MongoDB",
    "Segment",
    "Bamboo",
  ];
  return (
    <div className="skills">
      <h1 className="skills_header">Skills</h1>
      <div className="skills_section">
        {skills.map((skill, key) => {
          return (
            <div className="skills_pill" key={key}>
              {skill}
            </div>
          );
        })}
      </div>
    </div>
  );
}
